import React from 'react';
import { motion } from 'framer-motion';
import { MapPin, Star, Award } from 'lucide-react';
import './Artists.css';
import NotionCupPreview from '../components/NotionCupPreview';

interface Artist {
  id: number;
  name: string;
  origin: string;
  flag: string;
  style: string;
  image: string;
  description: string;
  achievements: string[];
  featured: boolean;
  socialMedia: {
    instagram?: string;
    facebook?: string;
    youtube?: string;
  };
}

const artists: Artist[] = [
  {
    id: 1,
    name: "Cornel & Rithika",
    origin: "India",
    flag: "ðŸ‡®ðŸ‡³",
    style: "CONRI STYLE BACHATA",
    image: "/api/placeholder/300/400",
    description: "Revolutionary bachata style creators from India, bringing fresh perspectives to the dance world with their innovative Conri Style Bachata.",
    achievements: [
      "Creators of Conri Style Bachata",
      "International Bachata Champions",
      "Featured in major dance festivals worldwide",
      "YouTube sensations with millions of views"
    ],
    featured: true,
    socialMedia: {
      instagram: "@cornel_rithika",
      youtube: "Cornel & Rithika Official"
    }
  },
  {
    id: 2,
    name: "Ronald & Alba",
    origin: "Spain",
    flag: "ðŸ‡ªðŸ‡¸",
    style: "BACHATA",
    image: "/api/placeholder/300/400",
    description: "Spanish bachata masters known for their passionate and authentic dance style, bringing the true essence of Dominican bachata to the world.",
    achievements: [
      "Spanish Bachata Champions",
      "World Bachata Masters",
      "International workshop instructors",
      "Featured performers at major festivals"
    ],
    featured: true,
    socialMedia: {
      instagram: "@ronald_alba_bachata",
      facebook: "Ronald & Alba Bachata"
    }
  },
  {
    id: 3,
    name: "Korke & Judith",
    origin: "Spain",
    flag: "ðŸ‡ªðŸ‡¸",
    style: "CREATORS OF BACHATA SENSUAL",
    image: "/api/placeholder/300/400",
    description: "The legendary creators of Bachata Sensual, revolutionizing the dance with their innovative style that has influenced millions of dancers worldwide.",
    achievements: [
      "Creators of Bachata Sensual",
      "World-renowned dance instructors",
      "International Bachata Champions",
      "Authors of bachata instructional materials"
    ],
    featured: true,
    socialMedia: {
      instagram: "@korke_judith",
      youtube: "Korke & Judith Official"
    }
  },
  {
    id: 4,
    name: "Leandro & Jomante",
    origin: "Spain | Lithuania",
    flag: "ðŸ‡ªðŸ‡¸ðŸ‡±ðŸ‡¹",
    style: "BACHATA",
    image: "/api/placeholder/300/400",
    description: "International bachata duo bringing together Spanish passion and Lithuanian precision, creating a unique fusion that captivates audiences worldwide.",
    achievements: [
      "International Bachata Champions",
      "European Bachata Masters",
      "Featured in major dance competitions",
      "Workshop instructors across Europe"
    ],
    featured: true,
    socialMedia: {
      instagram: "@leandro_jomante",
      facebook: "Leandro & Jomante"
    }
  }
];

const Artists: React.FC = () => {
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: { staggerChildren: 0.2 },
    },
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 30 },
    visible: {
      opacity: 1,
      y: 0,
      transition: { duration: 0.6, ease: "easeOut" },
    },
  };

  return (
    <>
      {/* âœ… NotionCupPreview at the top */}
      <NotionCupPreview />

      {/* Line Up Section */}
      <section className="lineup-section">
        {/* Centered Image */}
        <div className="lineup-hero-image">
          <img 
            src="/placeholder-lineup-hero.jpg" 
            alt="Line Up Hero" 
            className="lineup-hero-img"
          />
        </div>

        {/* Bachata Line Up */}
        <div className="lineup-content">
          <h2 className="lineup-title">
            BACHATA LINE UP 2025<br />
            <span className="lineup-subtitle">LATIN NOTION BACHATA FESTIVAL, DUBAI</span>
          </h2>

          <div className="lineup-grid bachata-grid">
            {Array.from({ length: 12 }, (_, index) => (
              <div key={`bachata-${index}`} className="lineup-item">
                <img 
                  src={`/placeholder-bachata-${index + 1}.jpg`} 
                  alt={`Bachata Artist ${index + 1}`}
                  className="lineup-image"
                />
              </div>
            ))}
          </div>

          <h2 className="lineup-title">
            DJ LINE UP 2025<br />
            <span className="lineup-subtitle">LATIN NOTION BACHATA FESTIVAL, DUBAI</span>
          </h2>

          <div className="lineup-grid dj-grid">
            {Array.from({ length: 4 }, (_, index) => (
              <div key={`dj-${index}`} className="lineup-item">
                <img 
                  src={`/placeholder-dj-${index + 1}.jpg`} 
                  alt={`DJ ${index + 1}`}
                  className="lineup-image"
                />
              </div>
            ))}
          </div>
        </div>
      </section>

    </>
  );
};

export default Artists;
